import React from "react";
import Pokemon from './Pokemon';

class Cards extends React.Component {
    render() {
        const {pokemons} = this.props;
        return (pokemons.map((pokemon) => <Pokemon key={pokemon.id} pokemon={pokemon}/>
        ))
    }

}

export default Cards
